import CardBook from "../CardBook"

const Waterfall = () => {
    return (
        <div
            style={{
                backgroundColor: 'red',
                width: 930,
                columnCount: 4
            }}
        >
            {Array(10).fill(0).map(post => (
                <CardBook
                    post={{
                        title: 'title',
                        image: '//aa',
                        type: 'image',
                        user: {
                            username: 'username',
                            avatar: '//aa'
                        },
                        count: {
                            likes: 1
                        }
                    }}
                />
            ))}
        </div>
    )
}

export default Waterfall
